def determine_winner(test_cases):
    results = []
    for door in test_cases:
        n = len(door)
        i = 1
        op = []
        while i < n:
            if door[i] == '_':
                j = 1
                while i < n and door[i] == '_':
                    i += 1
                    j += 1
                op.append(j - 1)
            i += 1
        if not op:
            results.append('Bob')
        elif len(op) == 1 and op[0] <= n - 1:
            results.append('Alice')
        elif len(op) == 1 and op[0] == n:
            results.append('Bob')
        else:
            xor = op[0]
            for i in range(1, len(op)):
                xor ^= op[i]
            if xor > 0:
                results.append('Alice')
            else:
                results.append('Bob')
    return results

